{"name": "create_performance_optimization_indexes", "query": "
-- Create indexes to optimize the slow query

-- Index on participants_events for filtering and grouping
CREATE INDEX IF NOT EXISTS idx_participants_events_participant_id 
ON participants_events(participant_id);

-- Index on participants_events for event lookups
CREATE INDEX IF NOT EXISTS idx_participants_events_event_id 
ON participants_events(event_id);

-- Composite index on stats for the WHERE clause in subqueries
CREATE INDEX IF NOT EXISTS idx_stats_holder_type_id 
ON stats(stat_holder_type, stat_holder_id);

-- Index specifically for persons stats lookups
CREATE INDEX IF NOT EXISTS idx_stats_persons_holder_id 
ON stats(stat_holder_id) 
WHERE stat_holder_type = 'persons';

-- Index on stats for counting distinct stat_repository_type
CREATE INDEX IF NOT EXISTS idx_stats_repository_type_holder 
ON stats(stat_holder_type, stat_holder_id, stat_repository_type);

-- Index on events for the start_date_time used in MAX aggregate
CREATE INDEX IF NOT EXISTS idx_events_start_date_time 
ON events(start_date_time);

-- Composite index on events for efficient lookups
CREATE INDEX IF NOT EXISTS idx_events_id_start_date 
ON events(id, start_date_time);

-- Add index comments for documentation
COMMENT ON INDEX idx_participants_events_participant_id IS 'Optimizes participant filtering and grouping';
COMMENT ON INDEX idx_stats_holder_type_id IS 'Optimizes stats lookups by holder type and ID';
COMMENT ON INDEX idx_stats_persons_holder_id IS 'Partial index for persons stats - reduces index size';
COMMENT ON INDEX idx_events_start_date_time IS 'Optimizes date range queries and MAX calculations';
"}
